INSERT INTO `exercise` (`Id`, `content`, `detail`, `input1`, `output1`, `input2`, `output2`, `input3`, `output3`, `input4`, `output4`, `input5`, `output5`, `level`, `time`) VALUES
(1, 'Tính tổng 2 số', 'Viết chương trình tính tổng 2 số tự nhiên được nhập từ bàn phím.', '1 1', '2', '2 2', '4', '4 4', '8', '8 8', '16', '11 11', '22', 'Easy', 4000),
(2, 'Tính tích 2 số', 'Viết chương trình tính tích 2 số tự nhiên được nhập từ bàn phím.', '2 2', '4', '3 4', '12', '2  5', '10', '1 232', '232', '11 13', '143', 'Easy', 4000),
(3, 'Tính hiệu 2 số', 'Viết chương trình tính hiệu 2 số tự nhiên được nhập từ bàn phím.', '3123123 32432', '3090691', '3423 432', '2991', '1 2', '-1', '321 221', '100', '260102 101102', '159000', 'Easy', 4000),
(4, 'Tính thương 2 số', 'Viết chương trình tính thương 2 số tự nhiên được nhập từ bàn phím.', '10000 100', '100', '44 11', '4', '132 11', '12', '231 4', '57.75', '125 5', '25', 'Easy', 4000),
(5, 'Kiểm tra số nguyên tố', 'Kiểm tra số n nhập từ bàn phím có phải số nguyên tố hay không .Nếu đúng thì in ra \"n is a prime number\",nếu không đúng thì in ra \"n is not a prime number', '29', '29 is a prime number', '13', '13 is a prime number', '24', '24 is not a prime number', '14', '14 is not a prime number', '100000000000000', '100000000000000 is not a prime number', 'Medium', 10000),
(7, 'Đổi chỗ 2 số', 'Nhập 2 số từ bàn phím.In ra thứ tự ngược lại 2 số được nhập từ bàn phím', '213 321312', '321312 213', '3 4', '4 3', '1 2', '2 1', '134 512', '512 134', '321312312 3213123123123', '3213123123123 321312312', 'Easy', 5000),
(8, 'Kiểm tra số chẵn lẻ', 'Kiểm tra một số được nhập từ bàn phím.Nếu số đó là số chẵn thì in ra \"even\",nếu số đó là số lẻ thì in ra \"odd\"', '4', 'even', '3123123122', 'even', '214325463453243', 'odd', '31', 'odd', '0', 'even', 'Easy', 5000),
(9, 'Tìm ước chung lớn nhất', 'Nhập 2 số nguyên từ bàn phím.In ra ước chung lớn nhất của 2 số đó', '23 12', '1', '34 12 ', '2', '48 36', '12', '100 525', '25', '144 12', '12', 'Hard', 5000),
(10, 'Tìm bội chung nhỏ nhất của 2 số', 'Nhập 2 số tự nhiên từ bàn phím.Kết quả sẽ là bội chung nhỏ nhất của 2 số', '12 18', '36', '1 21312312321312', '21312312321312', '15 25', '75', '24 36', '72', '14 18', '126', 'Hard', 5000),
(11, 'Tính lũy thừa', 'Nhập 2 số tự nhiên a,b từ bàn phím.In ra kết quả a^b', '2 4', '16', '2.7 4', '53.1441', '2.4 2', '5.76', '1.6 3', '4,096', '1.7 3', '4.913', 'Medium', 5000),
(12, 'Tìm 2 chữ số tận cùng của lũy thừa', 'Nhập 2 số a,b từ bàn phím.In ra kết quả 2 chữ số tận cùng của a^b', '23 4', '41', '19 7', '39', '100 12', '00', '12 3', '28', '7 7', '43', 'Easy', 5000),
(13, 'Tổng các số tự nhiên đến n', 'Nhập số tự nhiên n từ bàn phím.Tính tổng các số tự nhiên từ 0 đến n.Nếu n âm thì in ra -1', '10', '55', '22', '253', '44', '990', '-1', '-1', '1000', '500500', 'Medium', 5000),
(14, 'Tìm số lớn nhất trong 3 số', 'Cho 3 số nguyên nhập từ bàn phím.Viết chương trình in ra màn hình số nguyên có giá trị lớn nhất', '1 2 3', '3', '231 3213 123', '3213', '-12 321 -231', '321', '0 0 -1', '0', '-1 -2 -3', '-1', 'Medium', 5000),
(15, 'Kiểm tra năm nhuận', 'Nhập một số n từ bàn phím.Hãy viết chương trình kiểm tra xem năm n có phải năm nhuận không', '2004', '2004 is a leap year', '2023', '2023 is not a leap year', '2000', '2000 is not a leap year', '1900', '2000 is not a leap year', '2012', '2012 is a leap year', 'Hard', 5000),
(16, 'Chọn ô', 'Cho một bảng kích thước 4 xN (gồm N cột mỗi ô(i,j) có điểm bằng a[i][j] .Bạn cần chọn một tập hợp các ô sao cho tổng điểm đạt được là lớn nhất,không có 2 ô nào chung cạnh (Cần chọn 1 nhất 1 ô)\r\nInput:\r\n1<=N<=10000\r\n-10000<=a[i][j]<=10000\r\nOutput:Đáp án tìm được', '3 -1 9 3 -4 5 -6 7 8 9 9 7 2', '32', '2 -1 -5 -2 -6 -3 -7 -4 -8', '-1', '5  1 -2 -3 4 5 5 2 4 5 1 -9 1 2 3 4 5 6 3 2 -4', '29', '3 7 8 9 9 8 7 5 6 7 1 2 3', '38', '3 -2 5 -2 1 2 3 3 9 8 0 10 1', '26', 'Hard', 10000),
(17, 'Tổng số nguyên tố', 'Nhập số tự nhiên n từ bàn phím.Kiểm tra xem số n có phải là tổng 2  số nguyên tố hay không.Nếu có thì in ra 2 số nguyên tố đó.Nếu không thì in ra:\r\n\"n can\'t be expressed as sum of two prime numbers.\"', '20', '20 = 3 + 17 20 = 7 + 13', '34', '34 = 3 + 31 34 = 5 + 29 34 = 11 + 23 34 = 17 + 17', '231', '231 = 2 + 229', '17', '17 can\'t be expressed as sum of two prime numbers.', '24', '24 = 5 + 19 24 = 7 + 17 24 = 11 + 13', 'Hard', 10000);
